import React from "react";
import "../styles/Projects.css";

function Projects() {
  return (
    <section className="projects" id="projects">
      <h2>My Projects</h2>
      <div className="project-list">
        <div className="project-card">
          <h3>Dream Portfolio</h3>
          <p>A soft pastel React portfolio with elegant UI and animations.</p>
        </div>
        <div className="project-card">
          <h3>Khareedgar</h3>
          <p>An aesthetic e-commerce site made with ShadCN UI & custom styling.</p>
        </div>
        <div className="project-card">
          <h3>AI Chatbot UI</h3>
          <p>A stylish and responsive chatbot interface with CSS animations.</p>
        </div>
      </div>
    </section>
  );
}

export default Projects;
